  input: '"TEXT","F3XA","C00071365","The wrong election date appeared on our 12 G
    report; it should have been for the election on 11/2/04.  This has been corrected
    on our amended report.  The transfers from John Breaux Committee Operating Account
    have been moved to line 11c.  All FEA activity have been moved to line 30b, since
    no Levin funds were used for these activities we understand that National Party
    funds may be used to pay for Federal Election Activity, that are not otherwise
    exempt activities, that are paid exclusively with federal funds. All appropriate
    salaried employees have been moved to line 30b.  All allocable expenses are paid
    either exclusively with federal dollars or with a combination with federal and
    non fed funds in accordance with the commissions allocation regulations. All appropriate
    radio ads, postage and printing costs have been move to line 30b, if not otherwise
    stated they are administrative and not FEA or reference federal candidates.  All
    appropriate payments for health insurance have been moved to line 21b.  All maintenance,
    janitorial services, music, and music deejays are independent contractors and
    not employed by the Louisiana Democratic Party.  Please note that the Louisiana
    Democratic Party owns its own building and does not make any regular rent payments.  Please
    note that all other administrative expenses are disclosed on our reports.  Further,
    please note that the Louisiana Democratic Party has not accepted any in-kind contributions
    in connection with its office expenses.  Please note the original report inadvertently
    had an itemization threshold of $0 instead of $200."'
